import Inputfield from "../Inputfield/Inputfield";
const form_field =[
    {
     type:"text",
     id:"userid",
     class:"form-control",
     placeholder:"Email or phone number"

    },
    {
        type:"password",
        id:"password",
        class:"form-control",
        placeholder:"Password"
        
    },
    {
     type:"submit",
     id:"submit",
     class:"btn btn-primary",
     value:'Log in'
}
]
const Form =()=>{
    return (
    <form style={
      {
        width:"30rem",
        height:'15rem',
        backgroundColor:'white',
        borderRadius:'.5rem',
        boxShadow: '0 2px 4px rgba(0, 0, 0, .1), 0 8px 16px rgba(0, 0, 0, .1)',
        marginTop:'10%'
        
      }
    }>
        <div class="form-group row px-3" 
        >
          {
            form_field.map((element,key)=>{
                return <Inputfield key={key} type={element.type} id={element.id} name={element.name} className={element.class} placeholder={element.placeholder}  value={element.value}/>
            })
          }
        </div>
         
      </form>
    )
}
export default Form ;
